凹んだ乳首のケアに乳首吸引器「プチフィット」！装着したまま下着を付けても目立たないので、誰にも知られずケアできます。吸着効果をよくするために同梱のローションを塗布してから装着して下さい。<br><br><br><img src="/smilehouse/cabinet/ntop/henpin.gif"><!--注意事項--><br><br><!--注意事項end--><style type="text/css">

